import React, {Fragment} from 'react';

class App extends React.Component{

	constructor(props){
		super(props);
		this.state = {
			items: [],
			isLoaded: false,
		}
	}

	componentDidMount(){
		fetch('https://opentable.herokuapp.com//api/cities')
		.then(res => res.json())
		.then(json => {
			this.setState({
				isLoaded: true,
				items: json, 
			})
		});

	}
	render(){

		var{ isLoaded, items} = this.state;

		if(!isLoaded){
			return <div>Loading...</div>;
		}
		else{
			return
					<div className="App">
						<ul>
							{items.map(item => (
								<li key={item.id}>
									Cities: {item.cities} | Count: {item.count}
								</li>
								))};
						</ul></div>			
			// return(
			// 		<div className="App">
